              ref: "start_year", defaultValue: "2014", 
              onChange: function(event) {
                  this.props.start_year = event.target.value;
                }.bind(this)
              }
            )
          ), 
            React.createElement("input", {type: "number", className: "form-control", 
              ref: "end_year", defaultValue: "2014", 
              onChange: function(event) {
                  this.props.end_year = event.target.value;
                }.bind(this)
              }
            ), 
            React.createElement("select", {className: "form-control", 
              defaultValue: this.props.news_desk, 
              onChange: function(event) {
                          this.props.news_desk = event.target.value;
                       }.bind(this)
             }, 
               React.createElement("option", {value: "National"}, "National"), 
               React.createElement("option", {value: "Sports"}, "Sports"), 
               React.createElement("option", {value: "Foreign"}, "Foreign"), 
               React.createElement("option", {value: "Culture"}, "Culture"), 
               React.createElement("option", {value: "Society"}, "Society")
            ), 
            React.createElement("input", {type: "submit", bsStyle: "primary", 
              value: "Submit"})
        ), 
          React.createElement("div", {className: "col-lg-6"}, 
            React.createElement(Cloud, {data: cloud_data, 
              callback: this.word_click_handler})
